import React, { Component } from 'react';
import { StyleSheet, View, Text } from 'react-native';

import * as firebase from "firebase/app";
import "firebase/firebase-database";
import firebaseConfig from '../src/config/fire';

import { Card, CardItem, Thumbnail, Body, Left, Right, Button, Icon, Item } from 'native-base';

const welfareRef = firebase.database().ref();
const requiredDocuments = welfareRef.child('구비서류');


export default class Welfare extends Component {
    constructor(props) {
        super(props);
        this.state = ({
            requiredDocuments: [],
            loading: false,
        });
    }

    componentDidMount() {
        if (!firebase.apps.length) {
            firebase.initializeApp(firebaseConfig);
        }

    }

    render() {
        console.log(requiredDocuments)
        return (
            <View style={style.container}>
                <Card>
                    <CardItem>
                        data = {this.state.requiredDocuments}
                        renderItem = {({ item, index })}
                        <Text>{Item.구비서류}</Text>

                    </CardItem>
                </Card>
            </View>
        );
    }
}

const style = StyleSheet.create({
    container: {
        flex: 1,
        alignItems: 'center',
        justifyContent: 'center',
    }
})
